import styles from "./header.css";
import { data } from "../../utils/data";
import { useState } from "react";

import {Box} from "@ya.praktikum/react-developer-burger-ui-components/dist/index.js";


function Header() {
  
  return (
    <header className={styles.header}>
      <Box>
        <div>
          <button>Конструктор</button>
          <button>Лента заказов</button>
        </div>
        <div>
          <img src="" alt="Stellat_Burgers" className="logo"/>
        </div>
        <div>
          <button className="burger-lk">Личный кабинет</button>
        </div>
      </Box>
    </header>
  );
}

export default Header;
